import { Button } from "@mui/material"
import classes from './ProjectList.module.css'
import React from "react"
export interface IProps{
    id:string,
    name:string,
    developer:string,
    client:string,
    maintenaceMode:string

}
const ProjectList : React.FC<{onProps:IProps[]}>=(props)=>{
return (
  
       
    <ul >
    <div >{props.onProps.map((item, index)=>{
        
    return  <div className={classes.specificproject} key={index}>
     <li className={classes.allBody}><Button > {`שם: ${item.name}`} {`מפתח: ${item.developer}`} {`לקוח: ${item.client}`} {`סטטוס: ${item.maintenaceMode}`}  לפרוייקט לחץ כאן  </Button></li>

</div>
    })}</div>
    </ul>
    
)
}

export default ProjectList
